import React from 'react';
import { Link } from 'react-router-dom';
import * as Iocons from 'react-icons/io';

function SideMenu() {
    return (
        <>
            <div className = 'Side-menu'>
                <Link to="#" className = 'menu-bars'>
                    <Iocons.IoIosArrowBack />
                </Link>
            </div>

        </>
    );
}

export default Side_menu;
